import { useState } from "react";

 
function StudentForm(){
    const[id,SetId]=useState("")
    const[Name,SetName]=useState("")
    const[City,SetCity]=useState("")
    const[RollNO,SetRollNo]=useState("")
    const[Mobile,SetMobile]=useState("")
    const[Course,SetCourse]=useState("")
    const[DOJ,SetDOJ]=useState("")

    return(
        <fieldset>
<form>
  <div class="mb-3">
    <label for="ID">ID</label> <input type="number" value={id} placeholder="Enter ID" disabled/>
  </div>
  <div class="mb-3">
    <label for="Name">Name</label>
    <input type="text" value={Name} placeholder="Enter Name" required/>
  </div>
  <div class="mb-3">
    <label for="City">City</label>
    <input type="text" value={City} placeholder="EnterCity" required/>
  </div>
  <div class="mb-3">
    <label for="RollNo">Reg No</label>
    <input type="number" value={RollNO} placeholder="Enter Reg NO" required/>
  </div>
  <div class="mb-3">
    <label for="Mobile">Mobile</label>
    <input type="text" value={Mobile} placeholder="Enter Mobile No" required/>
  </div>
  <div class="mb-3">
    <label for="Course">Course</label>
    <input type="text" value={Course} placeholder="Enter Name" required/>
  </div>
  
  <button type="submit" class="btn btn-primary">Submit</button>
</form>
        </fieldset>
    )
}
export default StudentForm;
